import React from 'react'

function GitHubUser(){
    return(
        <>
        <div style={{width:'80%',backgroundColor:'lightseagreen',margin:'auto'}}>
        <h2 style={{textAlign:'center',padding:'8px'}}>List of Git Hub Users</h2>
        </div>
        </>
    )
}
export default GitHubUser;
